const Login = () => {
  const theme = useTheme();

  return (
    <Box>
        <Box
              width="100%"
              backgroundColor={theme.palette.background.alt}
          >
                <Typography>SOCIAL</Typography>
            </Box>

        <Box>
              <Typography>
                  Welcome to Socail Media
              </Typography>
              <div>
                  


            </div>
        </Box>
        </Box>
  );
};

export default Login;
